// src/components/About.js
import React from 'react';
import './About.css';

function About() {
  return (
    <section id="about">
      <div>
        <h2>About</h2>
        <p>
          My name is Calvin Nguyen, a multifaceted professional with extensive experience and a strong interest in technology and cybersecurity. I have a background as a veteran, having served in the US Army, and I have obtained various certifications including CISA and Google certifications in Cybersecurity, Data Analytics, and Project Management. I'm proficient in tools like Splunk for SIEM and have a strong grasp of coding practices. I am a full-stack developer. I'm also engaged in continuous learning and community involvement, reflecting a dedication to personal and professional growth.
        </p>
      </div>
    </section>
  );
}

export default About;
